    <script>
        var myElement = document.getElementById("Skull");
        var mic;
        var micLevel;
        function setup() {
            mic = new p5.AudioIn();
            mic.start();
        }
        function draw() {
            micLevel = ((mic.getLevel() * 50) + 1);
            scaleById(micLevel);
        }

        function scaleById(micLevel) {
            myElement.style.transform = 'scale(' + (micLevel) + ' )';
            myElement.style.transformOrigin = 'center';
        }
